export default ({ title, description, children }) => {
	return (
		<div class='lg:w-1/3 w-full my-6 bg-blue-500 pr-3'>
			{children}
			<h4 class='font-semibold text-gray-800 my-3'>{title}</h4>
			<p class='text-gray-700 tracking-wide font-light'>{description}</p>
		</div>
	);
};
